async function ({url}, {h1Tag}, {externalContext}) {
  const browser = await externalContext.launch();
  const page = await browser.newPage();
  await page.goto(url);
  const h1Element = await page.$('h1');
  if (h1Element) {
    const text = await page.evaluate(element => element.textContent, h1Element);
    h1Tag.next(text);
  }
  await browser.close();
}
